import React from 'react';
import './App.css'; // Import your main CSS file

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="hamster-row">
          <img src={require('./assets/row1.gif').default} alt="Row 1" />
        </div>
        <div className="hamster-row">
          <img src={require('./assets/row2.gif').default} alt="Row 2" />
        </div>
        <div className="hamster-row">
          <img src={require('./assets/row3.gif').default} alt="Row 3" />
        </div>
      </header>
    </div>
  );
}

export default App;
